import React from 'react'

function VideoTitle() {
    return (
        <div className='absolute text-white pt-[18%] p-32 z-10 bg-black bg-opacity-50 shadow-lg rounded-lg'>
          <h1 className='text-6xl font-bold'>Easy development</h1>
          <p className='py-6 w-[40%] pl-4'>
            Learn how to develop with ease. So that you can do great in your life. So you should keep learning and keep exploring, or else you will be stagnant in your life and you will never face the world more confidently, mark my words.
          </p>
          <div className='flex mt-4'>
            <button className='text-base font-medium bg-yellow-500 px-4 py-2 hover:bg-yellow-600 rounded-lg'>Play</button>
            <button className='text-base font-medium bg-yellow-500 px-4 py-2 ml-3 hover:bg-yellow-600 rounded-lg'>Watch more</button>
          </div> 
        </div>
      );
}

export default VideoTitle
